import { useState } from 'react';
import axios from 'axios';
import NavBar from './NavBar';
import { useNavigate } from 'react-router-dom';
import './css/main.css';
import './css/image-analysis.css';

export default function Imageanalysis() {
  const [selectedImage, setSelectedImage] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  // Ïù¥ÎØ∏ÏßÄ ÏóÖÎ°úÎìú Ïãú ÎØ∏Î¶¨Î≥¥Í∏∞ + Î∂ÑÏÑù ÏöîÏ≤≠
  const handleImageChange = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setSelectedImage(file);
    setPreviewUrl(URL.createObjectURL(file));
    setAnalysisResult(null);
    setLoading(true);

    try {
      const formData = new FormData();
      formData.append('file',file);

      const response = await axios.post('http://localhost:8000/predict', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
        withCredentials: true
      });

      //setAnalysisResult(response.data);
      console.log("üçΩ ÏòàÏ∏° Í≤∞Í≥º:", response.data);
    } catch (error) {
      console.error('‚ùå ÏòàÏ∏° Ïã§Ìå®:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
      <NavBar />
      <div className="analysis-wrapper">
        <div className="analysis-inner">
          <h1 className="analysis-title">üçïÏù¥ÎØ∏ÏßÄ Î∂ÑÏÑùü•§</h1>

          {/* üì§ ÏóÖÎ°úÎìú Î≤ÑÌäº */}
          <label htmlFor="imageUpload" className="upload-button">
            ÏùåÏãù Ïù¥ÎØ∏ÏßÄ ÏóÖÎ°úÎìú
          </label>
          <input
            id="imageUpload"
            type="file"
            accept="image/*"
            onChange={handleImageChange}
            style={{ display: 'none' }}
          />

          {/* üñºÔ∏è Ïù¥ÎØ∏ÏßÄ ÎØ∏Î¶¨Î≥¥Í∏∞ */}
          {previewUrl && (
            <div className="image-preview">
              <img src={previewUrl} alt="ÏóÖÎ°úÎìúÎêú ÏùåÏãù" />
            </div>
          )}

          {/* Î∂ÑÏÑù Ï§ë Î©îÏãúÏßÄ */}
          {loading && <p style={{ color: '#888' }}>üîç Î∂ÑÏÑù Ï§ëÏûÖÎãàÎã§...</p>}

          {/* Î∂ÑÏÑù Í≤∞Í≥º Ïπ¥Îìú */}
          {selectedImage && (
            <div className="result-card">
              <div className="predicted-class">
                üçΩÔ∏è ÏòàÏ∏° Í≤∞Í≥º: <strong>{analysisResult.predicted_Class}</strong>
              </div>
              <div className="confidence-score">
                Ïã†Î¢∞ÎèÑ: {(analysisResult.confidence * 100).toFixed(2)}%
              </div>

              {analysisResult.calories && (
                <>
                  <div className="predicted-class">ü•ó ÏòÅÏñëÏ†ïÎ≥¥</div>
                  <div>üç± ÏπºÎ°úÎ¶¨ : {analysisResult.calories} kcal</div>
                  <div>üçî ÌÉÑÏàòÌôîÎ¨º : {analysisResult.carbohydrates} g</div>
                  <div>üçñ Îã®Î∞±Ïßà : {analysisResult.protein} g</div>
                  <div>üç∞ ÏßÄÎ∞© : {analysisResult.fat} g</div>
                </>
              )}
            </div>
          )}
          <div className="button-group">
          <button
              onClick={() => {
                if (analysisResult?.predicted_class) {
                  navigate(`/cafe-recommend/${analysisResult.predicted_class}`);
                }
              }}
              className="button secondary"
              disabled={!analysisResult?.predicted_class}
            >
              ÏãùÎãπ Ï∂îÏ≤ú
            </button>
            <button
              onClick={() => navigate('/meal-recommend')}
              className="button secondary"
            >
              ÏãùÎã® Ï∂îÏ≤ú
            </button>
          </div>
        </div>
      </div>
    </>
  );
}
